import React from 'react';
import {
  TableContainer,
  Table,
  TableHead,
  TableRow,
  TableCell,
  TableBody,
  Paper,
} from '@material-ui/core';
import {Edit, Delete} from '@material-ui/icons';

class FlightList extends React.Component {
  handleEditClick = (id) => {
    this.props.onEditClick(id);
  }

  handleDeleteClick = (id) => {
    this.props.onDeleteClick(id);
  }

  render () {
    const {flights} = this.props;
    return (
      <TableContainer component={Paper}>
        <Table
          components={{
            Body: props => (
              <div>
                <button>Add an Add</button>
              </div>
            ),
          }}
        >
          <TableHead>
            <TableRow>
              <TableCell>Name</TableCell>
              <TableCell>Country</TableCell>
              <TableCell>Location</TableCell>
              <TableCell>Action</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {flights.map (flight => (
              <TableRow key={flight.name}>
                <TableCell>{flight.name}</TableCell>
                <TableCell>{flight.country}</TableCell>
                <TableCell>{flight.location}</TableCell>
                <TableCell><Edit onClick={() => this.handleEditClick(flight.id)}/>&nbsp;<Delete onClick={() => this.handleDeleteClick(flight.id)}/></TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    );
  }
}

export default FlightList;
